import './Cover.css';
import { Link } from 'react-router-dom';

function Cover() {
  return (
    <>
      <header>
        <h1 id='header-cover'> MPT Fitness App</h1>
      </header>
      <div>
        <Link to='/signup'>
          <button tabIndex={1} id='signup-cover'>Sign Up</button>
        </Link>
      </div>
      <div>
        <Link to='/login'>
          <button tabIndex={2} id='login-cover'>Login</button>
        </Link>
      </div>
  </>
  );
}

export default Cover;
